import React, { Component } from 'react'
import { Row, Col,Input,Button } from 'antd';


export class Home extends Component {
    onCreate =()=>{
        this.props.history.push('/create');
    }
    render() {
        return (
<Row >
<Row type = "flex" justify="space-around" align="middle" style ={{margin:"100px"}}>
<Col span={6}>
<Button block size ="large" type="primary" shape="round" size={64}
    onClick={this.onCreate}
    >
          Create
        </Button>    
        </Col>
    <Col span={6}>
    <Button block shape="round">Play</Button>
    </Col>
</Row>
</Row>
        )
    }
}

export default Home
